text:
1. Camito de cu é rola;
2. Fernandes na lateral não dá;
3. Jair... O time não sabe atacar... É só bumba meu boi;
4. Raça e vontade não ganha campeonato...
5. É preciso alternativas de jogo...
6. Mais importante... Se o elenco é limitado devemos decidir o que disputar de fato porque tudo esta claro que não dá e o desgaste sera sempre muleta...
AVANTE FOGÃO!

1. Repito: Camito de cu é rola... Não acerta um cruzamento;
2. Guilherme é peladeiro, dribla e nada... não passa a bola, muito burro;
3. A zaga é lenta, todo mundo sabe, menos o time do Botafogo...
4. Time pode virar, mas insisto... Time não sabe propor o jogo, o meio não cria nada... Raça ganha jogo, Não campeonato...

Equívocos:
1) contratação de Berrío e Rômulo;
2) escalação de Gabriel e Rômulo;
3) entrada de Matheus Savio e Juan;
4) esquema tático defensivo ou desobediência tática;
Vai pra conta do Rodrigo Caetano.
Mantenha-se o técnico, que é jovem, quer aprender e é da casa. Não tem nada de melhor no mercado.

1 - Renato Chaves não serviria nem ao sub-12 com aquela jogada; 
2 - Árbitro comemorou o gol da mulambada;
3 - Time morto como tem sido a maioria dos jogos.

Uma verdade e uma mentira:

-Vasco é sério candidato ao rebaixamento no Brasileirão 2017;
-O respeito voltou.
